import Layout from '../comps/FormLayout'

export default function Name() {
  return (
	<Layout>
	    <form>
		  <label>
		    Name:
		    <input type="text" name="name" />
		  </label>
		  <input type="submit" value="Submit" class="submitbutton"/>
		</form>
	</Layout>
  );
 return (
 	<Layout />
 );
}
